  false,\n\t\"url\": null,\n\t\"notes\": \"The Horseshoe Bend Division of the Mark
  Twain National Wildlife Refuge Management Plan guides the long-range development
  of the Division, by identifying and integrating appropriate habitats, management
  strategies, program elements, and facilities which support the goals and objectives
  for which the Division was established. This plan is divided into the following
  chapters: General background, legal constraints, wetland management, upland management
  and public use management.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
